window.bookSummaryJSON = "<p><b>What happens when Millie finds out the only thing she's been sure about in her life might be a lie?</b></p> <p>Through the crazy twists and turns of her young life, Millie's only been sure of one thing: her dad's undying love for her. What happens when she finds out he might not really be her dad?</p> <p>There's another man who's been controlling Millie's destiny since before she was bornâ€”a man her mom married two days before she gave birth to Millie. Could this man be her biological father? Will finding this out break Millie's heart?</p> <p>Once again, Millie must dive back into the fray to solve the last mystery of her complicated history. With Navy SEAL Mason glued to her side, she'll discover secrets she never wanted to know and walk headfirst into the most dangerous situation she's faced yet.</p> <p>Millie's known from the beginning that finding out the truth could get her killed. This time, she might be right.</p> <p>Wild Card <i>is a spicy and suspenseful Navy SEAL romance. Millie Marsh is a fiercely independent CIA agent. Mason Davis is a headstrong Navy SEAL. Join them for this final chapter in their story.</i></p>"; 
